package com.myh.api;

public class StockData {

	private String todayInWorth;
	private String todayOutWorth;
	
	private String monthInWorth;
	private String monthOutWorth;
	
	private Long goodCount;
	private Long goodLess;
	private String stockWorth;
	
	private String todayInCount;
	private String todayOutCount;
	
	public StockData() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getTodayInWorth() {
		return todayInWorth;
	}
	public void setTodayInWorth(String todayInWorth) {
		this.todayInWorth = todayInWorth;
	}
	public String getTodayOutWorth() {
		return todayOutWorth;
	}
	public void setTodayOutWorth(String todayOutWorth) {
		this.todayOutWorth = todayOutWorth;
	}
	public String getMonthInWorth() {
		return monthInWorth;
	}
	public void setMonthInWorth(String monthInWorth) {
		this.monthInWorth = monthInWorth;
	}
	public String getMonthOutWorth() {
		return monthOutWorth;
	}
	public void setMonthOutWorth(String monthOutWorth) {
		this.monthOutWorth = monthOutWorth;
	}
	public Long getGoodCount() {
		return goodCount;
	}
	public void setGoodCount(Long goodCount) {
		this.goodCount = goodCount;
	}
	public Long getGoodLess() {
		return goodLess;
	}
	public void setGoodLess(Long goodLess) {
		this.goodLess = goodLess;
	}
	public String getStockWorth() {
		return stockWorth;
	}
	public void setStockWorth(String stockWorth) {
		this.stockWorth = stockWorth;
	}
	public String getTodayInCount() {
		return todayInCount;
	}
	public void setTodayInCount(String todayInCount) {
		this.todayInCount = todayInCount;
	}
	public String getTodayOutCount() {
		return todayOutCount;
	}
	public void setTodayOutCount(String todayOutCount) {
		this.todayOutCount = todayOutCount;
	}
	
	
	
}
